import Link from 'next/link';
import List from '../boards/List';

const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about" route={List}>
      <a style={linkStyle}>About</a>
    </Link>
  </div>
);

export default Header;
